import React from "react";
import Home from "./Home";
const App = () => {
    return(
    <>
        <Switch>
            <Route exact path="/" component={HOME} />
            <Route exact path="/about" component={HOME} />
            <Route exact path="/service" component={HOME} />
        </Switch>
    </>
    );
}

export default App;
